:p></o:p></span></p><p class="MsoNormal" style="margin: 0in -0.5in 8pt -0.2in;"><span style="font-size: 12pt; line-height: 17.12px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4.3 Change the Background color to “<span style="color: rgb(8, 82, 148); font-weight: bold;">Blue</span>”<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0in -0.5in 8pt -0.2in;"><span style="font-size: 12pt; line-height: 17.12px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4.4 Choose the middle Alignment<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0in -0.5in 8pt -0.2in;"><span style="font-size: 12pt; line-height: 17.12px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4.5 Change the&nbsp;<b>Text size</b>&nbsp;to “<span style="font-weight: bold;">14</span>”<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0in -0.5in 8pt -0.2in;"><span style="font-size: 12pt; line-height: 17.12px;">&nbsp; &nbsp; - (5) In&nbsp;<b>General&nbsp;</b>change the&nbsp;<b>Width&nbsp;</b>to&nbsp;<b>"185"&nbsp;</b>and&nbsp;<b>Height&nbsp;</b>to&nbsp;<b>"125"&nbsp;</b>&nbsp;&nbsp;</span></p><p class="MsoNormal" style="margin: 0in -0.5in 8pt -0.2in;"><span style="font-size: 12pt; line-height: 17.12px;">&nbsp; &nbsp; - (6) Turn the Border on ---&gt; choose "<span style="font-weight: bold; color: rgb(8, 82, 148);">Blue"</span></span></p><p class="MsoNormal" style="margin: 0in -0.5in 8pt -0.2in;"><span style="font-size: 12pt; line-height: 17.12px;">&nbsp; &nbsp;&nbsp;</span><img src="data:image/gif;base64,R0lGODlhWAJ7AfcAAAD/AAFarwNKjQVWmwZhsgdtwwpoug8PDRR3xhZWjRt6xhxttCF/ziNVgSNjmSR2uyUlJCZbiSkrODeBvjltljmN1D86M0NDQUawYEpNRkyCsk5QSlCY01Cp8lEiU1JTUFQreFVQK1p+m19hXl+ob2J+r2htbWm492qs4muexWytg2+OsnCWuHCo0HFTbXNybnZwcnh5d3x8en1yZH614n7B93+AfICmhYCpyYE6f4GCfoKDeYOoZIWFgoaIh4eftIetkoixnok8RomKiIpaj4yNi5CRj5C42ZFPFJKIO5Ksu5NwtZSVkpWdkZbS+5fepZijnZmYlJmalpucmZufnZ2gnZ6mj5+hnp++eaG2xKLD36SkoaWrpqeLBaqrqKrK5au7wqyvrLCvrLGwrrKxq7KzsLLW8rLiorOtqbW0s7W1srW2tLazs7bAzLe0ybi4tri/z7qplru9t7vmqLy9urzHzL3P3r3tm75ueb7Bvr7
